    false,nt"url": null,nt"notes": "This document describes the Brigantine
    Wilderness Area which has been studied pursuant to the Wilderness Act of 1964 to
    determine its potential for inclusion in the National Wilderness Preservation System.
    The following topics were discussed: history of the area, its location, public use
    of the area, resources the area provides, and future development of the area. It
    was concluded that about 4250 acres of the Brigantine Wilderness Area were suitable
    for inclusion into the National Wilderness Preservation System.",nt"license_title":
